import React from 'react'
import Change from './footer.js'

class Nav extends React.Component{
    render(){
    return(
        // <div style={{display: 'flex' , flexDirection:'row',
        // backgroundColor: 'blue'}}>
        <div className='navbar'>
            <span>Logo</span>
        <ul>
            <li onClick={this.Change}>Home</li>
            <li>Service</li>
            <li>Contact</li>
        </ul>
        </div>
        
    )
}}
    
export default Nav
